function submit(){
	var code = document.getElementById("code").value;
	var result = document.getElementById("result")
	
	if (code=="")
	{
		result.innerHTML = "";
		return;
	}
	
	if(code in data){
		var x = "<b>"+data[code]+"</b>";
		if(code in clist){
			x = x + "<br><br><b>Students:</b><br>";
			for(var i in clist[code]){
				x = x + clist[code][i] + "<br>";
			}
		}else{
			x = x + "<br><br>Sorry! This isn't a Y10 or Y12 class, so we don't have the student list for this particular class!";
		}
		result.innerHTML = x;
	}else{
		var x;
		if(code in clist){
			x = "Teacher not found! You are either getting a new teacher, or one hasn't yet been assigned.";
			x = x + "<br><br><b>Students:</b><br>";
			for(var i in clist[code]){
				x = x + clist[code][i] + "<br>";
			}
		}else{
			x = "This class doesn't exist. Make sure you've spelled it correctly, with capital letters and no spaces.";
		}
		result.innerHTML = x;
	}
}

